Prerna Sthal, was virtually inaugurated on 11 October 24 by Hon‚Äôble Raksha Mantri Shri Rajnath Singh. The inauguration ceremony at Burdang, #Sikkim was attended by the Hon'ble Governor of #Sikkim, Om Prakash Mathur, Chief Minister Shri Prem Singh Tamang and Lieutenant General NS Raja Subramani #VCOAS. They laid wreaths and paid tributes to the 22 #Bravehearts, who laid down their lives during the flash floods caused by glacial outburst from South Lhonak Lake in October 2023.The families of the brave soldiers were also felicitated during the ceremony.

Prerna Sthal, which was developed in collaboration between the Governor‚Äôs office and the #IndianArmy, now stands as a symbol of bravery, sacrifice, and inspiration for soldiers, tourists, and the local community. 

